import React from 'react'
import PropTypes from 'prop-types'
import {useState} from 'react';
import {GetAllProject} from '../HuddleComponents/GetAllProjects.js';
export default function Header(props) {
    const [searchAreaInputVal, setSearchAreaInputVal] = useState("");
    // Input Field handler
    const handlesearchInputVal = (e) => {
        setSearchAreaInputVal(e.target.value);
    };
    // Reset Input Field handler
    const resetserachAreaInput = () => {
        setSearchAreaInputVal("");
    };
    return (
        <nav className="navbar navbar-expand-lg navbar-light bg-light">
        <div className="container-fluid">
          <a className="navbar-brand" href="#">{props.title}</a>
          <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
            <span className="navbar-toggler-icon"></span>
          </button>
          <div className="collapse navbar-collapse" id="navbarSupportedContent">
            <ul className="navbar-nav me-auto mb-2 mb-lg-0">
              <li className="nav-item">
                <a className="nav-link active" aria-current="page" href="#" onClick={()=>{props.showLeftNav()}}>Home</a>
              </li>
              <li className="nav-item">
                <a className="nav-link" href="#">About</a>
              </li>  
                <GetAllProject bucketNameDropdown={"true"} showAllTicketOfBucket={props.showAllTicketOfBucket}/>
            </ul>
            {props.searchBar ? <form className="d-flex">
              <input className="form-control me-2" type="search" placeholder="Search by ticket id" aria-label="Search" value={searchAreaInputVal} onChange={handlesearchInputVal}/>
              <button className="btn btn-outline-success" type="submit" onClick={()=>{console.log(ticketId);let ticketId = searchAreaInputVal;resetserachAreaInput();if(!isNaN(ticketId)){props.showSearchResult(ticketId)}else{alert("Ticket id can be numeric only")}}}>Search</button>
            </form> : ""}
          </div>
        </div>
      </nav>
    )
}
Header.defaultProps = {
    title: "The Huddle",
    searchBar : true
}
Header.propTypes = {
    title: PropTypes.string,
    searchBar: PropTypes.bool
}
